  null,\n\t\"notes\": \"This plan discusses the main types of land use at Parker River
  National Wildlife Refuge.  Information about geology and water, groundwater, climatic
  conditions, history of past uses, and soil classifications are provided.  Land use
  types discussed in this plan include farming, grassland management, timber utilization,
  fur resources, shellfish harvesting, commercial fishing, and fruit picking.  Maps
  are provided for the various crop units on the refuge.\",\n\t\"license_title\":
